import React from 'react';


function Food({name}){
  console.log(name);
  return (
    <h1>i like {name} </h1>
  )

}


const foodILike = [
  {
    name : "kimchi",
    image : "https://cdn.imweb.me/thumbnail/20200415/6b6e035658bac.png"
  },
  {
    name : "kimbab",
    image : "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.10000recipe.com%2Frecipe%2F6851844&psig=AOvVaw2yNNUAPlRWmYp199NG79zq&ust=1614651087897000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCIjvpZaCju8CFQAAAAAdAAAAABAD"
  },
  {
    name: "jajang",
    image : "https://recipe1.ezmember.co.kr/cache/recipe/2016/07/02/40c4f639ca973d9acccecdf7cbe0cbc41.jpg"
  }
];

function App() {
  return (
    <div className="App">
      <h1 id="222">dohyun</h1>
      <span className="ddd">hyun</span>
      hello! react
      {foodILike.map(dish => (
        <Food 
        name={dish.name} />
      ))}
    </div>
  );
}

export default App;
